import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => (
  <nav className="navbar">
    <Link to="/">Home</Link>
    <Link to="/projects">Projects</Link>
    <Link to="/experience">Experience</Link>
    <Link to="/admin">Admin</Link>
  </nav>
);

export default Navbar;
